pyqgis_plugin.about:
The plugin allows to compute the noise level generated by point source or by road source at fixed receiver points and buildings.
Please consider the following semplifications:
- the modelization is 2D;
- no reflections or diffractions are calculated;
- the terrain is flat.

&lt;b&gt;Load QSS allows the user to load his/her own *.qss files and change the look and feel of Qgis.&lt;/b&gt;
