- Basemap: Add dozens of global basemaps from Carto, ESRI, Google, OSM Stamen, HCMGIS Aerial Images,...; 

- Vn-2000 Projections: Define local UTM projections for each provinces of VietNam in Vn-2000 CRS;

- HCMGIS OpenData: Download free and open geodata from http://opendata.hcmgis.vn; 

- Spatial Processing: Create Skeleton/Medial Axis/ Centerline for road/ river networks and similar linear structures, create Centerline in Polygon&#39;s gaps (E.g building blocks) (layers must be in projected coordinate reference system), finding closest/ farthest pair of Points in a Point set, merge layers (with the same geometry type), split layer (based on unique field), 

- Attribute Calculation: merge/ split data fields, Vietnamese Font Converter: Unicode &lt;-&gt; TCVN3 &lt;-&gt; Vni-Windows, UPPER CASE, lower case,...,

- Batch Converter: Batch convert XY to Point (CSV to Shapefile) in a folder and subfolders

One assumes that the QGIS layer has continuous ids of points. The points has &quot;file_names&quot; field of photo file names&lt;br&gt;
that are separated with semicolons. The plugin can be started by a button with its icon on the plugin toolbar.&lt;br&gt;
You should first set a path to photos folder (&quot;path&quot; button).&lt;br&gt;
If in road inspection are more than one photo per point, You can add an extra windows (&quot;extra window&quot; button).&lt;br&gt;
You can check the plugin by using the example from &quot;example&quot; subfolder of the plugin folder.
Remember to select a layer with a road inspection and a start point first.

QWater is a plugin based on GHydraulics Plugin from &lt;a href=&quot;mailto:sdteffen@sdteffen.de&quot;&gt;Steffen Macke&lt;/a&gt;. It allows to design and analyze water supply networks using EPANET (no need to install). It allows to write EPANET INP files as well as running an EPANET simulation from QGIS complete with loading the result data. QWater contains a function to calculate economic diameters based on given diameters and maximum friction headloss. The functions are accessible from the Qgis plugin menu and toolbars.
